import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Pagina1 from './Pagina1';
import Pagina2 from './Pagina2';

function App() {
  return (
    <Routes>
        <Route  path="/" exact component={Pagina1} />
        <Route path="/pagina2" component={Pagina2} />
    </Routes>
  );
}

export default App;
